function getStoreListHtml(item, index){
    
    var listCarIcon = $('[data-listCarIcon]').attr('data-listCarIcon');
    var listCarIconAltText = $('[data-listCarIconAltText]').attr('data-listCarIconAltText');
    var listTruckIcon = $('[data-listTruckIcon]').attr('data-listTruckIcon');
    var listTruckIconAltText = $('[data-listTruckIconAltText]').attr('data-listTruckIconAltText');
    var listHankookMasterIcon = $('[data-listHankookMasterIcon]').attr('data-listHankookMasterIcon');
    var listHankookMasterIconAltText = $('[data-listHankookMasterIconAltText]').attr('data-listHankookMasterIconAltText');
    var listLinkIcon = $('[data-listLinkIcon]').attr('data-listLinkIcon');
    var listLinkIconAltText = $('[data-listLinkIconAltText]').attr('data-listLinkIconAltText');
    var listDirectionTitle = $('[data-listDirectionTitle]').attr('data-listDirectionTitle');
    var listDirectionIcon = $('[data-listDirectionIcon]').attr('data-listDirectionIcon');
    var listDirectionIconAltText = $('[data-listDirectionIconAltText]').attr('data-listDirectionIconAltText');
    var listWebsiteIcon = $('[data-listWebsiteIcon]').attr('data-listWebsiteIcon');
    var listWebsiteIconAltText = $('[data-listWebsiteIconAltText]').attr('data-listWebsiteIconAltText');
    var listCallIcon = $('[data-listCallIcon]').attr('data-listCallIcon');
    var listCallIconAltText = $('[data-listCallIconAltText]').attr('data-listCallIconAltText');
    
    
    var html = '';
                                
    html += '<div class="info-container find-a-store-container" data-infoindex="'+index+'" tabindex="'+index+'">';
    html += '    <div class="info-container__label">';
    html += '        <h2 class="font_body_1 text-position">'+item.DEAL_NM+'</h2>';
    html += '    </div>';

    let telNo = "";
    if(item.TEL_1_NO != null && item.TEL_1_NO != "" && item.TEL_2_NO != null && item.TEL_2_NO != "" && item.TEL_3_NO != null && item.TEL_3_NO != "") {
        telNo = item.TEL_1_NO + item.TEL_2_NO + item.TEL_3_NO;
    } else {
        telNo = item.TEL_OTHER_NO;
    }

    html += '    <div class="info-container__content">';
    html += '        <p class="font_body_3 text-position">'+item.ADDR+ '<br/>' + telNo +'</p>';
    html += '    </div>';
    
    html += '    <div class="inner-contents">';
    html += '        <div class="inner-contents-container">';
    
    if(item.DEAL_TYPE1 == 'A'){
        html += '            <img src="'+listCarIcon+'" alt="'+listCarIconAltText+'">';
        html += '            <img src="'+listTruckIcon+'" alt="'+listTruckIconAltText+'">';  
        html += '            <p class="font_body_3 text-position">'+carSuvVanTitle+', '+truckBusTitle+'</p>';  
    }else if(item.DEAL_TYPE1 == 'P'){
        html += '            <img src="'+listCarIcon+'" alt="'+listCarIconAltText+'">';
        html += '            <p class="font_body_3 text-position">'+carSuvVanTitle+'</p>';
    }else if(item.DEAL_TYPE1 == 'T'){
        html += '            <img src="'+listTruckIcon+'" alt="'+listTruckIconAltText+'">';
        html += '            <p class="font_body_3 text-position">'+truckBusTitle+'</p>';
    }
    html += '        </div>';
    if(item.DEAL_TYPE2 == 'M' && $("#hmCheck").val() != null){
        html += '        <div class="inner-contents-container">';
        html += '            <img src="'+listHankookMasterIcon+'" alt="'+listHankookMasterIconAltText+'">';
        html += '            <p class="font_body_3 text-position">Hankook Masters</p>';
        html += '        </div>';
    }
    
    
    if(item.SITE_URL){
        if(item.SITE_URL.indexOf("@") > 0){
            item.SITE_URL = 'mailTo://' + item.SITE_URL;
        }else if(!item.SITE_URL.toLowerCase().startsWith('http')){
            item.SITE_URL = 'http://' + item.SITE_URL;
        }
        html += '        <div class="inner-contents-last">';
        html += '        <a href="' + item.SITE_URL + '" target="_blank" rel="noopener noreferrer">';
        html += '            <img src="' + listLinkIcon + '" alt="' + listLinkIconAltText + '">';
        html += '                <p class="font_body_3 text-position">';
        html += '                    ' + item.SITE_URL + '</p>';
        html += '        </a>';
        html += '    </div>';
    }
    html += '</div>';

    html += '<div class="links-wrapper">';
    html += '    <div class="links-wrapper-container">';
    html += '        <a href="javascript:void(0);" onclick="getDirection(\''+item.LTD_VAL+'\', \''+item.LNTD_VAL+'\');">';
    html += '            <img src="' + listDirectionIcon + '" alt="' + listDirectionIconAltText + '" class="links">';
    html += '            <p class="font_caption">' + listDirectionTitle + '</p>';
    html += '        </a> ';
    html += '    </div>';
    
    if(item.SITE_URL){
        html += '    <div class="links-wrapper-container">';
        html += '        <a href="' + item.SITE_URL + '" target="_blank" rel="noopener noreferrer">';
        html += '            <img src="' + listWebsiteIcon + '" alt="' + listWebsiteIconAltText + '" class="links">';
        html += '            <p class="font_caption">' + $('[data-listWebsiteTitle]').attr('data-listWebsiteTitle') + '</p>';
        html += '        </a>';
        html += '    </div>';
    }
    
    var callNo = '';
    if(item.TEL_1_NO && item.TEL_2_NO && item.TEL_3_NO){
        callNo = 'tel:(' + item.TEL_1_NO + ')' + item.TEL_2_NO + '-' + item.TEL_3_NO;
    }else if(item.TEL_OTHER_NO){
        callNo = 'tel:' + item.TEL_OTHER_NO.replace(/ /g,"");
    }
    
    if(callNo){
        html += '    <div class="links-wrapper-container">';
        html += '        <a href="' + callNo + '">';
        html += '            <img src="' + listCallIcon + '" alt="' + listCallIconAltText + '" class="links">';
        html += '            <p class="font_caption">' + $('[data-listCallTitle]').attr('data-listCallTitle') + '</p>';
        html += '        </a>';
        html += '    </div>';
    }
    
    html += '</div>';
    html += '</div>';
    return html;
}
function getPageNavi(totCnt, pg){
    
    $('#totCnt').html(totCnt.toLocaleString(navigator.language));
    var pageHtml = '';
    pageHtml += pg.ajaxStartPage;
    pageHtml += pg.ajaxPrevPage;
    pageHtml += pg.ajaxPages;
    pageHtml += pg.ajaxNextPage;
    pageHtml += pg.ajaxEndPage;
    
    $('#page-box').html(pageHtml);
}
var preIndex = -1;
var infoWindowIndex;
function viewContents(m, e, isLeft){
    var index = m.index;
    var icon = m.active ? markerOffIcon : markerOnIcon;
    var active = m.active ? false : true;
    
    var infowindow = new google.maps.InfoWindow({
       maxWidth: 350,
       pixelOffset: new google.maps.Size(-10,-25)
    });
    
    infoWindowIndex = index;
    
    $('.gm-style-iw-t').remove();
    
    if(!m.active){
        
        var content = '<div class="mapLayer" data-layerindex="'+index+'">' +
            '<span class="dealNm">' + gmarkers[index].dealNm + '</span>' +
            '<span class="addr">' + gmarkers[index].addr + '</span>' +
            '</div>';
            
        
        infowindow.setContent(content);
        infowindow.open(googleMap);
        infowindow.setPosition(new google.maps.LatLng(gmarkers[index].position));
    }
    
    for(var i = 0; i < gmarkers.length; i++){
        gmarkers[i].active = false;
            gmarkers[i].setIcon({
            url : markerOffIcon
        });
    }
    if(!isLeft){
        if(preIndex != -1 && preIndex != index) {
             $('.detail__info').children().eq(preIndex).removeClass("active");
        }
        if(active) {
            $('.detail__info').children().eq(index).addClass("active");
        } else {
            $('.detail__info').children().eq(index).removeClass("active");
        }
    }
    
    gmarkers[index].active = active;
    gmarkers[index].setIcon({
        url : icon
    });
    
    if(isLeft && active){
        googleMap.setCenter(gmarkers[index].position);
    }
    
    preIndex = index;
    $('.find-a-store-container').eq(index).focus();
    
}
function removeMarkers() {
    for(var i = 0; i < gmarkers.length; i++){
        gmarkers[i].setMap(null);
    }
    gmarkers = [];
}
function removeListener() {
    for(var i = 0; i < gListener.length; i++){
        google.maps.event.removeListener(gListener[i]);
    }
    gListener = [];
}
function doFindStoreEnSearch(){
    
    if( typeof gtag_report_conversion == 'function' ) {
        gtag_report_conversion();
        
    }
    
    $('.gm-style-iw-t').remove();
    
    getStoreList(1, false, false);
    return false;
}
