function geoError(error){
    sessionStorage.setItem('geo_access', error.code);
    window.closePop('allow_pop');
//    alert('Your current location is not available.');

    switch (error.code) {
        case error.PERMISSION_DENIED:
            alert(locationDenied);
            break;
        case error.POSITION_UNAVAILABLE:
            alert(locationPosition);
            break;
        case error.TIMEOUT:
            alert(locationTimeout);
            break;
        default:
            alert(locationNotFound);
    }
    //getLocalWhereToBuyUsStoreList(true);
    //window.closePop('localWhereToBuyUs_allow_pop');
}
function geoSuccess(position){
    var pos = {
        lat: position.coords.latitude,
        lng: position.coords.longitude
    };
    
    uLat = position.coords.latitude;
    uLng = position.coords.longitude;
    uFlag = 'dist';
    isAllow = true;
    isLocBased = true;
    googleMap.setCenter(pos);
    locBasedCenter = googleMap.getCenter();
    sessionStorage.setItem('geo_access', '0');
    
    getStoreList(1, false);
}
function ajaxPaging(addValue, page){

    var arr = addValue.split("&");
    var searchQuery = '';
    for(var i = 0; i < arr.length; i++){
        var params = arr[i].split("=");
        if(params[0] == 'query'){
            searchQuery = params[1];
        }
    }
    getStoreList(page, false, true, searchQuery);
}
var isAllow = false;
var directionLat = '';
var directionLng = '';
function getDirection(lat, lng){
    
    directionLat = lat;
    directionLng = lng;
    
    if(uFlag || isAllow){
        window.open("https://www.google.com/maps/dir/"+uLat+","+uLng+"/"+lat+","+lng);
    }else{
        window.openPop('allow_pop2');
    }
}
function getDirectionAllow(){
    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(function(position) {
          var pos = {
            lat: position.coords.latitude,
            lng: position.coords.longitude
        };
        uLat = position.coords.latitude;
        uLng = position.coords.longitude;
        isAllow = true;
        isLocBased = false;
        window.open("https://www.google.com/maps/dir/"+uLat+","+uLng+"/"+directionLat+","+directionLng);
        
        }, geoError);
    }
    
    window.closePop('allow_pop2');
}
function findStoreEnLeftClick(){
   document.querySelector('.detail__info').addEventListener('click', function(e) {
    if(e.target && e.target.className.match(/info-container__label/)) {
      var infoIndex = $(e.target).parent().attr('data-infoindex');
      viewContents(gmarkers[infoIndex], e, true);
      
      $('.info-container__label').each(function(i){
         if(infoIndex != i){
            $(this).parent().removeClass("active");
         }
      });
      
      
      e.stopPropagation();
      e.preventDefault();
    } else if(e.target && e.target.className.match(/text-position/)) {
        
      if(!$(e.target).parent().hasClass('inner-contents-container') && !$(e.target).parent().parent().hasClass('inner-contents-last')){
      
          var infoIndex = $(e.target).parent().parent().attr('data-infoindex');
          viewContents(gmarkers[infoIndex], e, true);
          
          $('.info-container__label').each(function(i){
             if(infoIndex != i){
                $(this).parent().removeClass("active");
             }
          });
          e.stopPropagation();
          e.preventDefault();
        
      }
      
    }
  });
}

